import React from 'react';
import App from '../components/App';

class Index extends React.Component {
    render() {
        return (
            <div>
                <App></App>
                <style>
                    {`
                        body {
                            
                            background-color: black;
                        }
                    `}
                </style>
            </div>
        )
    }
}

export default Index;
